// src/components/Navbar.js
import React from 'react';
import logo from '../assets/img/logo.png'; // Import the logo image

const Navbar = () => {
  return (
    <div className='bg-white flex justify-between items-center px-8 h-20 shadow-md'>
      {/* Logo Section with Image */}
      <div>
        <img src={logo} alt='Logo' className='h-12 w-auto' />
      </div>

      {/* Navigation Links */}
      <nav>
        <ul className='flex space-x-8'>
          <li className='cursor-pointer'>Home</li>
          <li className='cursor-pointer'>About Us</li>
          <li className='cursor-pointer'>Contact Us</li>
          {/* Download Button */}
          <li>
            <button className='bg-orange-600 text-white px-4 py-2 rounded hover:bg-orange-700 transition duration-300'>
              Download App
            </button>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
